import React, { useEffect } from 'react';
import './App.css';
import io from 'socket.io-client'

import { Switch, Route } from 'react-router-dom';
import Home from './pages/Home';


function App() {
  useEffect(() => {
    const socket = io("http://localhost:8080");
  });

  return (
    <div className="App">
      <header className="App-header">
      </header>
      <Switch>
        <Route exact path='/'>
          <Home />
        </Route>
      </Switch>

    </div>
  );
}

export default App;
